(:action move
  :parameters (a1 b1)
  :precondition
    (and
      (at a1)
      (connected a1 b1)
      (or
        (not
          (isghost b1)
        )
        (invulnerable_step1)
        (invulnerable_step2)
      )
      (exists ?lo isfood)
    )
  :effect
    (and
      (at b1)
      (visited b1)
      (not
        (at a1)
      )
      (when
        (isghost b1)
        (not
          (isghost b1)
        )
      )
      (when
        (isfood b1)
        (not
          (isfood b1)
        )
      )
      (when
        (invulnerable_step2)
        (not
          (invulnerable_step2)
        )
      )
      (when
        (invulnerable_step1)
        (and
          (not
            (invulnerable_step1)
          )
          (invulnerable_step2)
        )
      )
      (when
        (iscapsule b1)
        (and
          (not
            (iscapsule b1)
          )
          (invulnerable_step1)
        )
      )
    )
)

